export TOKEN=$(gcloud auth print-access-token)
#export GOOGLE_CLOUD_PROJECT=$(gcloud config get project)

export COUNTER=0

while [ $COUNTER -le 10 ]
do
    RESULT=$(curl --location --request POST "https://firestore.googleapis.com/v1/projects/$GOOGLE_CLOUD_PROJECT/databases/(default)/documents/inspections?documentId=b78dfdb" \
    --header "Authorization: Bearer $TOKEN" \
    --header "Content-Type: application/json" \
    --data-raw "{
        'fields': {
            'id': {
                'stringValue': 'b78dfdb'
            },
            'description': {
                'stringValue': 'Warehouse Main Hall #1'
            },
            'dateTime': {
                'stringValue': '8/9/2023 9:38:51 AM'
            },
            'extinguishersCount': {
                'integerValue': '2'
            },
            'generatedCaption': {
                'stringValue': 'Two fire extinguishers are hanging on a pillar in a warehouse.'
            },
            'image': {
                'stringValue': 'data:image/jpeg;base64,#filename=fire-risk-assessment-services.jpeg'
            },
            'location': {
                'stringValue': '48.864716, 2.349014'
            },
            'looksSafe': {
                'stringValue': 'True'
            }
        }
    }")

    if [[ "$RESULT" == *error* ]]
    then
        COUNTER=$(( $COUNTER + 1 ))
        echo "Error detected, waiting 10s and then retry $COUNTER of 11 tries..."
        sleep 10s
    else
        COUNTER=11
    fi

done